		"text": "👀역사 서술의 규범은 누가 정의해 왔으며, 아직 그 역사의 일부가 되지 못한 이들은 누구인가를 치밀하게 질문하는 제58회 베니스비엔날레 한국관 전시는 2020년 3월 아르코미술관에서의 귀국전을 통해 서울에서 다시 그 질문을 지속하고자 합니다.\n\n사진제공: 베니스비엔날레 한국관 전시추진단 https://t.co/DqrCWBQ51J"
