		"text": "‘Turn on that Blue Vinyl’\n신종 코로나바이러스 감염증 대비 안내\n⠀\n안녕하세요, 블루바이닐입니다. 최근 신종 코로나바이러스 감염증이 확산된 가운데, 방역 대비책 및 앵콜 공연 티켓오픈 잠정 연기에 관한 안내 말씀드립니다.\n⠀\n⠀ https://t.co/Q6EMGx6wrb"
